"<div>\n<i class=\"NoteType\">\nL\u00e4hdeteksti\n</i>\n<div class=\"grampsstylednote\">\n<p>\nPerukirja Anna Mattsdotter T\u00f6yr\u00e4niemen j\u00e4lkeen selvitt\u00e4\u00e4 mm. h\u00e4nen tytt\u00e4rens\u00e4 Liisa Jaakontyt\u00e4r Anttilan alkuper\u00e4\u00e4 ja avioitumista Kangasalan K\u00f6yr\u00e4\u00e4n:<br />\nhttps://www.sukuhistoria.fi/sshy/sivut/jasenille/paikat.php?bid=15443&amp;pnum=751<br />\nPerukirjan sis\u00e4lt\u00f6\u00e4 aukikirjoitettuna:<br />\nhttps://www.geni.com/people/Anna-Anttila/6000000025343815587<br />\n\"Perunkirjoitus 4.10.1757 Onkkaala Anttila, enklingen Jacob Simonsson, afl. hru Anna Mattsdotter, tre s\u00f6ner Ture Palenius, Jacob och Johan, fem d\u00f6ttrar Maria, Lisa, Anna, Karin och Lena. Maria gift med rusthollare Matts Thomasson Mustala, Lisa med rusthollare Henric Simonsson ifr\u00e5n K\u00f6yr\u00e4 by, Anna med rusthollare Jacob Mattsson ifr\u00e5n Kerpola, Karin med rusthollare Henric Arvidsson ifr\u00e5n Laitikkala, Lena \u00e4r \u00e4nka. Detta Antila rusth\u00e5ll \u00e4r skatte.\"\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
